import React, { Component } from "react";
import { connect } from "react-redux";
import { authAxios, guestAxios } from "../../utils";
import { Link } from "react-router-dom";
import TextField from '@material-ui/core/TextField';
import { Row, Col } from "reactstrap"
import StoreHours from "./newStore/storeHours"

class NewStore extends Component {
    state = {
        data: {
            name: ""
        }
    }

    render() {
        return <div className="container">
            <br />
            <h3>Add Store</h3>
            <br />
            <TextField id="outlined-basic" fullWidth label="Name" variant="outlined" />
            <br />
            <br />
            <TextField id="outlined-basic" fullWidth label="About Us" variant="outlined" />
            <br />
            <br />
            <Row>
                <Col><TextField id="outlined-basic" fullWidth label="Latitude" variant="outlined" /></Col>
                <Col><TextField id="outlined-basic" fullWidth label="Longitude" variant="outlined" /></Col>
            </Row>
            <br />
            <h4>Store Hours</h4>
            <br />
            <NewStore />
        </div>
    }
}

const mapStateToProps = (state) => ({
    isAuthenticated: state.auth.isAuthenticated,
    auth: state.auth,
});

export default connect(mapStateToProps)(NewStore);
